const RECT_W = 100;
const RECT_H = 50;

export const useRectangles = () => {
  console.log('hit');
  function createRectangle(canvas: HTMLCanvasElement) {
    console.log('double hit');
    const context = canvas.getContext('2d');

    if (!context) return;
    //Our first draw
    context.fillStyle = '#000000';
    context.fillRect(0, 0, RECT_W, RECT_H);
  }


  return {
    createRectangle,
  }
};
